### Summary of Core Topics and Concepts

#### 1. **Linear Regression**
- **Simple Linear Regression (SLR):**
  - Model: \( y = \beta_0 + \beta_1 x + \epsilon \)
  - Transformation: Natural logarithmic transformation for non-linear relationships.
  - Degrees of Freedom: For regression term in ANOVA table, degrees of freedom = number of independent variables.
  - Prediction: Using the regression equation to predict dependent variable values.

- **Multiple Linear Regression (MLR):**
  - Model: \( y = \beta_0 + \beta_1 x_1 + \beta_2 x_2 + \ldots + \beta_n x_n + \epsilon \)
  - ANOVA Table: Understanding Sum of Squares (SS), Degrees of Freedom (df), Mean Squares (MS), and F-statistic.
  - Coefficients: Interpretation and significance testing using t-statistics and p-values.

#### 2. **Logistic Regression**
- **Model:** \( \log\left(\frac{p}{1-p}\right) = \beta_0 + \beta_1 x_1 + \beta_2 x_2 + \ldots + \beta_n x_n \)
- **Threshold:** Using a threshold to classify outcomes.
- **Evaluation Metrics:**
  - True Positives (TP)
  - True Negatives (TN)
  - False Positives (FP)
  - False Negatives (FN)
  - Accuracy: \( \frac{TP + TN}{TP + TN + FP + FN} \)
  - Precision: \( \frac{TP}{TP + FP} \)
  - Recall: \( \frac{TP}{TP + FN} \)

#### 3. **Elasticity**
- **Price Elasticity of Demand:** \( E_d = \frac{\% \Delta Q_d}{\% \Delta P} \)
- **Constant Elasticity Model:** \( Q = C \cdot P^k \), where \( k \) is the elasticity and \( C \) is a constant.

### Equations

#### Linear Regression
1. **Simple Linear Regression:**
   \[
   y = \beta_0 + \beta_1 x + \epsilon
   \]
   - \( y \): Dependent variable
   - \( x \): Independent variable
   - \( \beta_0 \): Intercept
   - \( \beta_1 \): Slope
   - \( \epsilon \): Error term

2. **Multiple Linear Regression:**
   \[
   y = \beta_0 + \beta_1 x_1 + \beta_2 x_2 + \ldots + \beta_n x_n + \epsilon
   \]
   - \( y \): Dependent variable
   - \( x_1, x_2, \ldots, x_n \): Independent variables
   - \( \beta_0 \): Intercept
   - \( \beta_1, \beta_2, \ldots, \beta_n \): Coefficients
   - \( \epsilon \): Error term

#### Logistic Regression
3. **Logistic Regression Model:**
   \[
   \log\left(\frac{p}{1-p}\right) = \beta_0 + \beta_1 x_1 + \beta_2 x_2 + \ldots + \beta_n x_n
   \]
   - \( p \): Probability of the outcome
   - \( x_1, x_2, \ldots, x_n \): Independent variables
   - \( \beta_0 \): Intercept
   - \( \beta_1, \beta_2, \ldots, \beta_n \): Coefficients

#### Elasticity
4. **Price Elasticity of Demand:**
   \[
   E_d = \frac{\% \Delta Q_d}{\% \Delta P}
   \]
   - \( E_d \): Price elasticity of demand
   - \( \% \Delta Q_d \): Percentage change in quantity demanded
   - \( \% \Delta P \): Percentage change in price

5. **Constant Elasticity Model:**
   \[
   Q = C \cdot P^k
   \]
   - \( Q \): Quantity demanded
   - \( C \): Constant
   - \( P \): Price
   - \( k \): Elasticity

